import React, { useState, useEffect } from 'react';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';
import { AdapterDayjs } from '@mui/x-date-pickers/AdapterDayjs';
import { DateTimePicker } from '@mui/x-date-pickers/DateTimePicker';
import { TextField } from '@mui/material';
import dayjs from 'dayjs';
import 'dayjs/locale/de';

dayjs.locale('de');

const BookingForm = ({ onClose, onSave, booking = null, vehicles = [] }) => {
  console.log("BookingForm geladen mit Fahrzeugen:", vehicles);
  console.log("Zu bearbeitende Buchung:", booking);

  // Initialer Formularstatus
  const [formData, setFormData] = useState({
    vehicle_id: '',
    start_date: '',
    end_date: '',
    purpose: '',
    notes: ''
  });

  // Wenn eine Buchung zum Bearbeiten übergeben wurde, initialisiere das Formular mit ihren Daten
  useEffect(() => {
    if (booking) {
      console.log("Initialisiere Formular mit Buchungsdaten:", booking);
      setFormData({
        vehicle_id: booking.vehicle_id || '',
        start_date: booking.start_date ? new Date(booking.start_date).toISOString().substring(0, 10) : '',
        end_date: booking.end_date ? new Date(booking.end_date).toISOString().substring(0, 10) : '',
        purpose: booking.purpose || '',
        notes: booking.notes || ''
      });
    }
  }, [booking]);

  // Form Change Handler
  const handleChange = (e) => {
    const { name, value } = e.target;
    console.log(`Feld ${name} geändert auf:`, value);
    setFormData({
      ...formData,
      [name]: value
    });
  };

  // Form Submit Handler
  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Formular wird abgeschickt mit Daten:", formData);
    onSave(formData);
  };

  // Formularanzeige
  return (
    <div className="fixed inset-0 bg-gray-800 bg-opacity-75 flex items-center justify-center z-50">
      <div className="bg-white rounded-lg p-8 max-w-2xl w-full max-h-90vh overflow-y-auto">
        <h2 className="text-xl font-bold mb-4">
          {booking ? 'Buchung bearbeiten' : 'Neue Buchung erstellen'}
        </h2>

        <form onSubmit={handleSubmit} className="space-y-4">
          {/* Fahrzeugauswahl */}
          <div className="mb-4">
            <label htmlFor="vehicle_id" className="block text-gray-700 text-sm font-bold mb-2">
              Fahrzeug:
            </label>
            <select
              id="vehicle_id"
              name="vehicle_id"
              className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
              value={formData.vehicle_id}
              onChange={handleChange}
              required
            >
              <option value="" disabled>
                Fahrzeug auswählen
              </option>
              {vehicles && vehicles.length > 0 ? (
                vehicles.map((vehicle) => (
                  <option key={vehicle.id} value={vehicle.id}>
                    {vehicle.displayName || `${vehicle.modell} / ${vehicle.kennzeichen}`}
                  </option>
                ))
              ) : (
                <option value="" disabled>
                  Keine Fahrzeuge gefunden
                </option>
              )}
            </select>
            {(!vehicles || vehicles.length === 0) && (
              <p className="text-red-500 text-xs italic mt-1">
                Keine Fahrzeuge verfügbar. Bitte stellen Sie sicher, dass Fahrzeuge im System registriert sind.
              </p>
            )}
          </div>

          {/* Startdatum */}
          <div className="mb-4">
            <label htmlFor="start_date" className="block text-gray-700 text-sm font-bold mb-2">
              Startdatum:
            </label>
            <input
              type="date"
              id="start_date"
              name="start_date"
              className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
              value={formData.start_date}
              onChange={handleChange}
              required
            />
          </div>

          {/* Enddatum */}
          <div className="mb-4">
            <label htmlFor="end_date" className="block text-gray-700 text-sm font-bold mb-2">
              Enddatum:
            </label>
            <input
              type="date"
              id="end_date"
              name="end_date"
              className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
              value={formData.end_date}
              onChange={handleChange}
              required
            />
          </div>

          {/* Zweck */}
          <div className="mb-4">
            <label htmlFor="purpose" className="block text-gray-700 text-sm font-bold mb-2">
              Zweck:
            </label>
            <input
              type="text"
              id="purpose"
              name="purpose"
              className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
              value={formData.purpose}
              onChange={handleChange}
              required
            />
          </div>

          {/* Notizen */}
          <div className="mb-4">
            <label htmlFor="notes" className="block text-gray-700 text-sm font-bold mb-2">
              Notizen:
            </label>
            <textarea
              id="notes"
              name="notes"
              className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
              value={formData.notes}
              onChange={handleChange}
            />
          </div>

          {/* Buttons */}
          <div className="flex justify-end space-x-2">
            <button
              type="button"
              onClick={onClose}
              className="bg-gray-300 hover:bg-gray-400 text-gray-800 font-bold py-2 px-4 rounded"
            >
              Abbrechen
            </button>
            <button
              type="submit"
              className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded"
            >
              Speichern
            </button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default BookingForm;
